import React from 'react'
import './home.css'
import shareHomeFeaturedData from '../../data/homeFeaturedData'
import { Link } from 'react-router-dom'


export default function Home() {
  let featuredDatas = shareHomeFeaturedData()
  return (
    <>
      <div className="showProducts">
        <ul className="ulFeaturedProducts">
          {featuredDatas.map((item, index) => {
            return (
              <Link to={`product/${item. parameter}`} key={index}>
                 <li className='listProducts' key={index.id}>
                   <div className="productImg">
                    <img src={item.img} alt="" />
                   </div>
                   <div className="productName">
                    <h2>{item.name}</h2>
                   </div>
                   <div className="productBrand">
                    <p>{item.brand}</p>
                   </div>
                 </li>
              </Link>


            )
          })}
        </ul>

      </div>


    </>
  )
}
